    def custom_url(self):
        """ récuperer l'url"""
        self.cust_url=[""]*len(self.images)
        got=False
        while got==False:
            get_custom=input("Voulez-vous intégerer votre propre url dans les images? [(o)ui/(n)on]")
            if len(get_custom)==1:
                if get_custom.lower()=="o":
                    own_or_file=input("Entrez i pour importer un fichier contenant les url pour chaque image.\nEntrez m pour entrez manuellement les url pour chaque image.\nEntrez c pour créer un fichier contenant déjà une base pour la liste d'images.\n[(i)mporter/(m)anuellment/(c)réer]")
                    if own_or_file=="i":
                        print("Emplacement du programme: {}".format(os.getcwd()))
                        fff=False
                        while fff==False:
                            get_filepath=input("Entrez le chemin d'accès pour le fichier de donnée:")
                            try:
                                f=open(get_filepath,"r")
                                c=f.read()
                                f.close()
                                print("Contenu du fichier '{}'={}".format(get_filepath,c))
                                word=""
                                self.cust_url=[]
                                for i in c:
                                    if i=="\n":
                                        # print("word=",word)
                                        self.cust_url.append(str(word))
                                        # print("self.cust_url=",self.cust_url)
                                        word=""
                                    else:
                                        word+=str(i)
                                # self.cust_url=c
                                print("self.cust_url={}".format(self.cust_url))
                                got=fff=True
                                print("Importation terminée.")
                            except:print("Fichier non trouvé.\nMerci de bien vouloir verifier le nom ou le chemin d'accès puis réessayez à nouveau.\nVous avez entré: {}".format(get_filepath))
                    elif own_or_file=="m":
                        for i in range(int(len(self.images)-1)):
                            self.cust_url[i]=input("Entrez l'url pour l'image '{}'\n Votre url:".format(self.images[i]))
                            print("self.cust_url[{}]=".format(i,self.cust_url[i]))
                        # print("self.cust_url=",self.cust_url)
                        print("Fini")
                        fff=got=True
                    elif own_or_file=="c":
                        get_filename=input("Entrez le nom que portera le fichier:")
                        for i in range(len(self.images)):
                            self.cust_url[i]=input("Entrez l'url pour l'image '{}'\n Votre url:".format(self.images[i]))
                            print("self.cust_url[",i,"]=",self.cust_url[i])
                        print("self.cust_url=",self.cust_url)
                        f=open(get_filename,"w")
                        for i in range(len(self.cust_url)):f.write("{}\n".format(self.cust_url[i]))
                        f.close()
                        print("Votre fichier se trouve dans: {}".format(os.getcwd()))
                        print("Fini")
                        fff=got=True
                elif get_custom.lower()=="n":got=True
                else:
                    print("Merci de ne rentrer que o pour oui ou n pour non.\nVous avez entré: {}".format(get_custom))
            else:
                print("Merci de ne rentrer qu'une seule lettre.")
